import React from 'react'
import { BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { Typography } from '@material-ui/core';
import { darkTheme } from '../theme';
import CustomTooltip from './CustomTooltip'

const data = [
    {name: "python", level: 0.85},
    {name: "R Code", level: 0.5},
    {name: "Random", level: 0.6},
]

const Testing = () => {

    return (
        <BarChart
          width={500}
          height={300}
          data={data}
          layout="vertical"
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <XAxis type="number" tick={null} label={null}/>
          <YAxis type="category" 
          dataKey="name" />
          <Tooltip content={<CustomTooltip />} cursor={{ stroke: 'red', strokeWidth: 2 }}/>
          <Legend />
          <Bar dataKey="level" fill={darkTheme.palette.secondary.main} />
        </BarChart>
    )
}

export default Testing
